afterHooks.code:
log('destroyNemo: called');
if (this.nemo) {
  if (this.nemo.driver) {
    log('Quitting nemo driver instance');
    return this.nemo.driver.quit()
      .then(function () {
        log('destroyNemo: Quit driver');
        return Promise.resolve();
      });
  }
  log('Nemo instance does not have a driver to quit');
}

